// SPDX-License-Identifier: MIT

pragma solidity ^0.8.18;

// import {PriceConverter} from "./PriceConverter.sol";
import { AggregatorV3Interface } from "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";


library PriceConverter {
    function getLatestPrice() internal view returns(uint256) {
        // Get the price of Dollar per ETH
        // Address 0x694AA1769357215DE4FAC081bf1f309aDC325306
        // ABI
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0xfEefF7c3fB57d18C5C6Cdd71e45D2D0b4F9377bF);
        (,int price,,,) = priceFeed.latestRoundData();
        return uint256(price) * 1e10;
    }
    function getConversionRate(uint ethAmount) internal view returns(uint256) {
        // Converts ETH into dollars
        uint256 ethPrice = getLatestPrice();
        uint256 ethAmoutnInUsd = (ethAmount * ethPrice) / 1e18;
        return ethAmoutnInUsd;
        
    }

    function getVersion() internal view returns(uint256) {
        return AggregatorV3Interface(0xfEefF7c3fB57d18C5C6Cdd71e45D2D0b4F9377bF).version();
    }
}

error NotOwner();

contract FundMe {
    using PriceConverter for uint256;

    uint256 public constant MINIMUM_USD = 5 * 1e18;
    address[] public funders;
    mapping(address funder => uint256 amountFunded) public addressToAmountFunded;

    address public immutable i_owner;
    constructor() {
        i_owner = msg.sender;
    }

    function fund() public payable {
        // require(getConversionRate(msg.value) > MINIMUM_USD, "didn't send enough ETH!"); // 1e18 = 1 ETH = 1 * 10 ** 18 WEI
        require(msg.value.getConversionRate() > MINIMUM_USD, "didn't send enough ETH!");
        funders.push(msg.sender);
        addressToAmountFunded[msg.sender] += msg.value;
    }

    function withdraw() public onlyOwner {
        for (uint256 funderIndex = 0; funderIndex < funders.length; funderIndex++) {
            address funder = funders[funderIndex];
            addressToAmountFunded[funder] = 0;
        }
        // Reset the array
        funders = new address [](0);

        // // Transfer
        // payable(msg.sender).transfer(address(this).balance);

        // // Send
        // bool sendSuccess = payable(msg.sender).send(address(this).balance);
        // require(sendSuccess, "Failed to send Ether");

        // Call
        (bool callSuccess, ) = payable(msg.sender).call{value: address(this).balance}("");
        require(callSuccess, "Call failed");
    }

    modifier onlyOwner() {
        // require(msg.sender == i_owner, "Only the contract i_owner can withdraw Ether");
        if (msg.sender != i_owner) {revert NotOwner();}
        _;
    }

    receive() external payable {
        fund();
    }

    fallback() external payable {
        fund();
     }
}

